import React from "react";
import { SafeAreaView, SectionList } from "react-native";
import styled from "styled-components/native";
import { Headline  } from "react-native-paper";
import { Place } from "../Place";

const data = [
  {
    "id": "5ecedf85b7d28c3ef0e24baa",
    "name": "Costa de Europa",
    "places": [
      {
        "id": "5edd5a61129de4226497f69e",
        "name": "Lugar calido",
        "mainImageUrl": "Prueba url",
        "activities": [
          {
            "id": "5ecee9fbe709a340b4b53c32",
            "name": "Prueba"
          }
        ]
      },
      {
        "id": "5edd5abb129de4226497f69f",
        "name": "Prueba",
        "mainImageUrl": "Prueba",
        "activities": []
      },
      {
        "id": "5eeb1038837dbe4c5063e01f",
        "name": "London",
        "mainImageUrl": "https://photos.mandarinoriental.com/is/image/MandarinOriental/paris-2017-home?$MO_masthead-property-mobile",
        "activities": []
      },
      {
        "id": "5eeb1079837dbe4c5063e020",
        "name": "Paris",
        "mainImageUrl": "https://lp-cms-production.imgix.net/2019-06/55425108.jpg?fit=crop&q=40&sharp=10&vib=20&auto=format&ixlib=react-8.6.4",
        "activities": []
      },
      {
        "id": "5eeb10926a921506b8a0dd7c",
        "name": "Paris",
        "mainImageUrl": "https://lp-cms-production.imgix.net/2019-06/55425108.jpg?fit=crop&q=40&sharp=10&vib=20&auto=format&ixlib=react-8.6.4",
        "activities": []
      },
      {
        "id": "5eeb10b6aa79102ca0186be5",
        "name": "London",
        "mainImageUrl": "https://lp-cms-production.imgix.net/2019-06/55425108.jpg?fit=crop&q=40&sharp=10&vib=20&auto=format&ixlib=react-8.6.4",
        "activities": []
      }
    ]
  },
  {
    "id": "5ecedfa3b7d28c3ef0e24bab",
    "name": "Playas",
    "places": []
  },
  {
    "id": "5ecedfb04fc85f3354bf7231",
    "name": "Montes",
    "places": []
  }
]

export const Layout = ({ navigation }) => (
  <Container>
    <SafeAreaView>
      <SectionList
        sections={data.map( region => ({
          id: region.id,
          title: region.name,
          data: region.places
        }))}
        keyExtractor={(item) => item.id }
        renderItem={({ item }) => 
          <Place name={item.name} mainImageUrl={item.mainImageUrl} placeId={item.id} navigation={navigation} />
        }
        renderSectionHeader={({ section: { title } }) => (
          <Headline style={{marginVertical: 10}}>{title}</Headline>
        )}
      />
    </SafeAreaView>
  </Container>
)

const Container = styled.ScrollView`
  flex: 1;
  padding: 0px 20px;
`;
